&lt;p&gt;Take a scenic ride through the skylines of Singapore as you step into the cabins of the cable cars. The Singapore Cable Cars take you on a captivating ride to exciting places like Sentosa Island where you can enjoy sun sand and sea, or Mount Faber Park where you can escape the hustle and bustle of city life at the tranquil hilltop park.&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;
&lt;p&gt;The cable cars offer a dazzling 360 degree view of the city sunrise and sundown and you can board them from Mount Faber, HarbourFront Tower 2 or Sentosa Island.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;
&lt;p&gt;Ticketing counters operate from 8.45 a.m. to 9.15 p.m. and they are located at Mount Faber, HarbourFront Tower 2, the Singapore Cruise Center @ HarbourFront Center (Passenger Service) and Imbiah Lookout at Sentosa Island. Travel to HarbourFront MRT station or take bus numbers 93, 166, 97, 960, 124&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;
&lt;p&gt;Opening hours 8.45am to 10.00pm&amp;nbsp;daily with last boardings at 9.30 .p.m.&lt;/p&gt;
&lt;p&gt;Children below the age of 3 fly for free!&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Go beyond the screen and Ride The Movies&amp;trade; at Universal Studios Singapore&amp;trade;. Experience cutting-edge rides, shows, and attractions based on your favorite blockbuster films and television series, including Puss In Boots&amp;rsquo; Giant Journey, Battlestar Galactica: HUMAN vs. CYLON&amp;trade;, TRANSFORMERS The Ride: The Ultimate 3D Battle, Jurassic Park Rapids Adventure&amp;trade;, Sesame Street Spaghetti Space Chase and more!&amp;rdquo;&lt;/p&gt;
&lt;p&gt;Timings:&lt;/p&gt;
&lt;p&gt;Monday to Sunday 10:00AM to 6:00PM&lt;/p&gt;
