&lt;p&gt;Explore the marine realm at S.E.A. Aquarium&lt;span style=&quot;font-size: 11.0pt; line-height: 107%; font-family: 'Calibri','sans-serif'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;&quot;&gt;&amp;trade;&lt;/span&gt; - one of Asia&amp;rsquo;s Top 3 Aquariums, and home to more than 100,000 marine animals of over 800 species. Be enthralled by fascinating marine creatures such as manta rays and enormous goliath groupers. A hands-on experience awaits at the Discovery Touch Pool where you can touch and learn more about sea stars and sea cucumbers. For an out-of-this-world dining experience, be sure to dine at Ocean Restaurant by Cat Cora where you can savour celebrity chef cuisine with a panoramic view of marine life. So make a trip down to S.E.A. Aquarium&lt;span style=&quot;font-size: 11.0pt; line-height: 107%; font-family: 'Calibri','sans-serif'; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: Calibri; mso-fareast-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: Arial; mso-bidi-theme-font: minor-bidi; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;&quot;&gt;&amp;trade;&lt;/span&gt; today. It&amp;rsquo;s an experience you won&amp;rsquo;t forget.&lt;/p&gt;
&lt;p&gt;Timings:&lt;/p&gt;
&lt;p&gt;Monday to Sunday: 10:00AM to 6:00PM&lt;/p&gt;
