&lt;p&gt;Opened in June 2012, Gardens by The Bay offers a premier yet unique tropical Singapore's Garden City at the heart of Marina Bay. In early 2006, an international design competion was held to seek a modern garden city in Singapore. There were more than 70 entries submited by 170 firms from 24 countries all over the world, which includes 35 from the home country itself. They are plenty of attractions for you to look forward for at Gardens by The Bay; mainly 2 conservatories which are Cloud Forest and Flower Dome, OCBC Skyway, Heritage Gardens, Supertree Grove and Dragonfly &amp;amp; Kingfisher Lakes. Gardens by The Bay offers its visitor guided tours, audio tours as well as self-guided trail. It also has launched their very own Gardens by The Bay app which can be downloaded at both Google Play and Apple Store. This app will help you to explore more about the place on the go!&amp;nbsp;&lt;/p&gt;
&lt;p&gt;&lt;em&gt;How to get there:&lt;/em&gt;&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Via the Circle Line or Downtown Line:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Alight at Bayfront MRT Station (CE1/DT16),Take Exit B and follow the underground linkway.Exit and cross the Dragonfly Bridge or Meadow Bridge into Gardens by the Bay&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;Via the East-West Line:&lt;/strong&gt;&lt;/p&gt;
&lt;p&gt;Alight at Tanjong Pagar MRT Station (EW15),Take Exit C and head towards the bus stop 03223 located at International Plaza, Anson Road.Hop onto bus service 400 and alight at bus stop 03371 along Marina Gardens Drive&lt;/p&gt;
&lt;p&gt;Opening hours:&lt;/p&gt;
&lt;p&gt;Cooled Conservatories &amp;amp; OCBC Skyway &amp;nbsp;9:00 AM - 9:00 PM, Daily.&lt;/p&gt;
&lt;p&gt;Bay South Outdoor Gardens&amp;nbsp;5:00 AM - 2:00 AM, Daily.&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;

&lt;p&gt;Home to the world&amp;rsquo;s largest Orang Utan colony found in zoos around the world, the Singapore Zoo features about almost 2,800 free roaming animals in true-to-life habitats. Nine time recipient of the Singapore Tourism Board&amp;rsquo;s Best Leisure Attraction Experience award, the Singapore Zoo is a must visit for any visitor to Singapore!Cradled within the luscious Mandai rainforest stretching to the Seletar Reservoir, the Singapore Zoo is 26 acres of park filled with over 300 species of animals big and small! The zoo and something for everyone!&lt;/p&gt;
&lt;p&gt;You can travel into the bushlands of Australia right here in Singapore when you enter the Australian Outback exhibit which features critters like bearded dragons,sugar gliders and the ubiquitous kangaroo!For those adventurous ones, venture off the beaten path into Wild Africa located at the southern end of the zoo. Featuring deadly predators like cheetahs and lions, docile peace loving giraffes and more!&amp;nbsp;&lt;/p&gt;
&lt;p&gt;A must see exhibit at the zoo would be the White Tigers, the crown jewel of the Singapore Zoo. Observe the majestic beauty of the White Tigers roaming,playing and lounging around in their jungle enclosure and if you&amp;rsquo;re lucky enough you might even catch them playing in the moat! White Tigers are a rarity in the wild so be sure to catch them at the Singapore Zoo!&amp;nbsp;The Singapore Zoo also conducts special shows like the Splash Safari show,Rainforest Fights Back show, Elephants at Work and Play show and the Animal Friends show, and animal feedings sessions for visitors so make sure to catch a show or two before you leave!&amp;nbsp;&lt;/p&gt;
&lt;p&gt;&lt;em&gt;How to get there:&lt;/em&gt;&lt;/p&gt;
&lt;p&gt;The easiest way to get here via public transport is to take the MRT on the North-South (Red) line and transit to connecting public bus services.&lt;/p&gt;
